INSERT INTO `portfolios` (`id`, `portfolio_name`, `portfolio_title`, `portfolio_image`, `portfolio_description`, `created_at`, `updated_at`) VALUES
(9, 'Hotel management system for house of koye', 'Web Development', 'upload/portfolio/1788279039105827.png', '<div class=\"flex flex-grow flex-col max-w-full\">\r\n<div class=\"min-h-[20px] text-message flex flex-col items-start gap-3 whitespace-pre-wrap break-words [.text-message+&amp;]:mt-5 overflow-x-auto\" data-message-author-role=\"assistant\" data-message-id=\"f091de2b-ce0f-4487-ad01-fc92b3e5853e\">\r\n<div class=\"markdown prose w-full break-words dark:prose-invert dark\">\r\n<p>House of Koye embarked on an innovative website project commissioned by our esteemed client. This exciting venture commenced on the 24th of March, 2023, with a clear directive to develop a contemporary website equipped with a robust support engine. The primary objective was to empower our client to dynamically manage and update the website\'s content regularly. Additionally, the project sought to integrate a sophisticated calendar management system tailored to accommodate the daily scheduling needs of our client and their distinguished guests.</p>\r\n<p>The multifaceted website not only prioritizes user engagement but also incorporates essential features such as SMTP settings for seamless email communication. This functionality ensures efficient communication channels for our client and their team, thereby enhancing overall productivity and responsiveness.</p>\r\n<p>One of the noteworthy components of the House of Koye website is the inclusion of a comprehensive blog management system. This system not only facilitates the creation and publication of engaging content but also incorporates a comment approval mechanism. This enables our client to actively oversee and manage customer comments related to their stay, fostering a sense of community and customer satisfaction.</p>\r\n<p>Furthermore, recognizing the collaborative nature of our client\'s business, the website extends its capabilities to accommodate their staff. This feature streamlines the booking process, allowing seamless engagement and coordination within the system. By including the staff on the platform, our client ensures a cohesive and organized approach to managing the bookings and reservations on the website.</p>\r\n<p>The administrative functions of the website are equally robust. The admin dashboard empowers our client to exercise control over critical aspects of the website. This includes the ability to manage the home page, providing flexibility in showcasing relevant and timely information. Additionally, the admin dashboard facilitates the effortless updating of the website\'s gallery, ensuring that the visual representation aligns with the brand\'s evolving narrative.</p>\r\n<p>The House of Koye website is not merely a digital presence; it is a dynamic tool designed to adapt to the evolving needs of our client\'s enterprise. The integration of a support engine stands as a testament to the forward-thinking approach adopted in its development. This engine empowers our client to take charge of the website\'s content, offering them autonomy in shaping the online experience for their audience.</p>\r\n<p>The calendar management system implemented on the website serves as a cornerstone in ensuring efficient daily operations. Our client can effortlessly organize and coordinate events, appointments, and guest schedules, optimizing the overall functionality of their business. This feature enhances not only their personal efficiency but also contributes to a seamless experience for guests interacting with the website.</p>\r\n<p>The incorporation of SMTP settings addresses the vital aspect of email communication. This feature guarantees reliable and secure email exchanges, crucial for a business of House of Koye\'s stature. Whether communicating with guests, managing reservations, or coordinating with the internal team, the SMTP settings provide a seamless and secure channel for all email-related activities.</p>\r\n<p>The blog management system is a key element in establishing a dynamic online presence. By providing a platform for the creation and publication of content, House of Koye can consistently engage its audience. The added ability to approve customer comments on their stay not only enhances transparency but also fosters a sense of community and trust.</p>\r\n<p>Recognizing the collaborative nature of the hospitality industry, the website extends its functionality to include staff members. This integration allows for efficient coordination in managing bookings and reservations. By bringing the staff into the system, our client ensures a unified approach, minimizing the risk of errors and enhancing overall operational efficiency.</p>\r\n<p>The administrative features of the website empower our client with the tools needed to maintain control and relevance. The ability to manage the home page ensures that the website reflects the latest offerings, promotions, and updates. This dynamic control over the website\'s front-end allows for agility in responding to market trends and customer preferences.</p>\r\n<p>Updating the gallery through the admin dashboard is a crucial aspect of keeping the visual representation aligned with the brand\'s identity. In an industry where aesthetics and visual appeal play a significant role, this feature allows House of Koye to showcase its facilities, services, and ambiance effectively. The admin dashboard serves as a centralized command center, streamlining the process of keeping the website visually captivating and up-to-date.</p>\r\n<p>In summary, the House of Koye website project stands as a testament to our commitment to innovation and client-centric solutions. By seamlessly integrating a support engine, calendar management system, SMTP settings, blog management, and staff collaboration features, we have created a dynamic digital platform that empowers our client to navigate the competitive landscape of the hospitality industry with agility and efficiency. The website not only reflects the contemporary ethos of House of Koye but also positions it as a forward-thinking and customer-focused brand in the digital realm.</p>\r\n<p>&nbsp;</p>\r\n<p>Website link: http://www.houseofkoye.com</p>\r\n</div>\r\n</div>\r\n</div>', '2024-01-17 01:02:59', '2024-04-10 03:49:44'),
(10, 'Our Social Media', 'Follow our story online', 'upload/portfolio/1795904792693119.png', '<p>LinkedIn, Instagram, Facebook and Twitter - search for us @obuchimultimedia</p>', '2024-04-10 04:05:50', '2024-04-10 04:17:55'),
(11, 'Music & Artistry', 'Empowering Entertainment through Artistic Collaboration and Showcasing Emerging Talent', 'upload/portfolio/1796810838864651.png', '<p>In the vibrant realm of the entertainment industry, there exists a dynamic body known as \"The DRIVE.\" This collective encompasses an exceptional fusion of musical artists and creative minds who are driven by a common goal: to portray positive messages through their captivating artistry and melodious soundscapes. As both a force in the industry and a distinctive brand in its own right, The DRIVE houses a remarkable lineup of talent, including the incomparable Dians, the visionary Percy, and the enigmatic Yng Kln, among other extraordinary individuals.</p>\r\n<p>Unveiling their latest endeavor, The DRIVE recently released a collaborative masterpiece titled \"WSTRN\" - a seven-track EP that serves as a testament to the boundless creativity and sheer brilliance of its featured artists. Garnering an overwhelming influx of streaming plays and eliciting heartfelt feedback from audiences worldwide, it is evident that The DRIVE is unwaveringly committed to delivering nothing short of musical excellence.</p>\r\n<p>However, The DRIVE\'s vision extends far beyond their own artistic triumphs. With the ever-evolving growth of the entertainment and art scenes, they eagerly anticipate their role as organizers of awe-inspiring shows, offering a captivating platform for emerging artists who are poised to make their mark on the industry. The DRIVE is passionate about uplifting these fast-rising talents, providing them with a unique opportunity to shine and leaving an indelible impact on the world of entertainment.</p>\r\n<p>Through their unwavering dedication to empowering entertainment through artistic collaboration and their relentless pursuit of showcasing emerging talent, The DRIVE stands as a beacon of inspiration and innovation. Their distinctive approach promises to reshape the landscape of the industry, infusing it with fresh perspectives, unparalleled creativity, and a genuine desire to spread positivity through their art. Join The DRIVE on this exhilarating journey, where boundaries are shattered, dreams come alive, and the future of entertainment is illuminated with vibrant possibilities.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', '2024-04-20 04:19:08', NULL),
(12, 'CSR & Capacity Development', 'CSR & Capacity Development', 'upload/portfolio/1796810861795323.png', '<p>We are committed to Corporate Social Responsibility (CSR) and Capacity Decelopment initiatives and are actively involved in projects that empower individuals and contribute to National Growth. &nbsp;<br />O&rsquo;BUCHI MULTIMEDIA has strategically managed Non-Governmental Organisations through project development, management, budgeting, and implementation. With our customer service expertise, we have been able to create and foster innovative relationships between our Clients and Private/National parastatals.<br />Working with Favour&rsquo;s Open Arms Foundation (FOAF), a Non-Governmental Organisation (NGO), we were able to develop, plan, and execute over 18 philanthropic outreaches and national projects in the sub-region and outside. This has enabled us to work with organizations like the Independent Nigeria Electoral Commission (INEC), Connected Development (CODE), YAIGA Africa, CISLAC, SOBCA, and other government and non-governmental organizations. gtj</p>', '2024-04-20 04:19:30', NULL);
INSERT INTO `services` (`id`, `services_title`, `services_description`, `services_image`, `created_at`, `updated_at`) VALUES
(4, 'Content Creation for Business Executives & SMEs', '<p>We help scale up the digital presence of Senior Executives and SMEs by developing tailored content to boast your personal brand and business needs.</p>\r\n<p>We create a digital calender to help grow your online presence, strengthen your network to foster credibility and trust.&nbsp;</p>', 'upload/services/1768423027824924.png', '2023-06-11 14:02:36', '2024-04-10 03:24:57'),
(6, 'Website Development', '<p>Transform your online presence with our expert website development services. From design to functionality, we create custom solutions that captivate audiences and elevate your brand\'s digital footprint. Let\'s build together!</p>', 'upload/services/1795226818771944.png', '2023-06-11 14:04:30', '2024-04-02 16:41:49'),
(8, 'Graphics Design & Infographics', '<p>We create designs, presentation slides and brochures to help you close that deal! Crafting unique, versatile graphics and infographics tailored to your brand\'s identity.</p>\r\n<p>From creating your logo, letterheads, business cards, rollup banners, social media content we got you covered A-Z!</p>\r\n<p>Elevate your brand with us today</p>', 'upload/services/1795226668249952.png', '2023-06-11 14:32:16', '2024-04-10 03:20:44'),
(9, 'Videography & Photography', '<p>Elevate your storytelling with our high quality videography and photography services for corporate events.</p>\r\n<p>We cover audiovisuals for Conferences, Workshops, Seminers, Trainings and CSR initiatives.&nbsp;</p>', 'upload/services/1795227310381862.png', '2024-04-02 16:49:38', '2024-04-10 02:51:12');
